      for (let i = 0; i < e.target.value; i++) {
        console.log("okoko" + i);
      }
    });
  });

  return (
    <>
      <label htmlFor="ok">CHECK</label>
      <h1>
        Hello guy <span className="si"></span>
      </h1>
      <input type="range" id="volume" name="volume" min="0" max="11"></input>
    </>
  );
};

export default App;
